const Share = () => {
  return (
    <div className='share'>
      <img src="/assets/person/1.jpeg" alt="" className="topbarImg cursor-pointer h-14 w-14 rounded-full object-cover"/>
      <code className='text-gray-400'>What's in your mind Youssef ?</code>

      Hey it's share
    </div>
  )
}

export default Share
